import React from "react";
import './specifications.css';
import fotoUM from './html.png'


function Especificacoes () {
    return(

<div className="especificacaoes">

    <div className="espp-content">

    <div className="esp um"> 
        <div className="foto1"><span>LALALALALA</span><img id="html" src={fotoUM}/>
            <div className="texto"></div><span>LALALALA</span></div>
        </div>

     

</div>


</div>
    )
}

export default Especificacoes
